import React from 'react'
import { useHistory } from 'react-router-dom'
import './Button.css'

function Button({title, type, disabled, action}) {

    const history = useHistory()

    return (
        <div className="button">
            <button 
                className = {type} 
                disabled = {disabled}
                onClick = {action} 
            >
                {title}
            </button>
        </div>
    )
}

export default Button
